#include "./../../main_test.h"

static void s21_test_truncate(s21_decimal value, s21_decimal result, int code,
                              char *text, int count);

//############################# EDGE CASE #####################################
START_TEST(s21_truncate_edge_1) {
  s21_decimal value_1 = {{0xD487DA, 0x0, 0x0, 0x0}};
  s21_decimal *value_2 = NULL;
  int code = 1;
  int my_code = s21_truncate(value_1, value_2);
  ck_assert_int_eq(code, my_code);
}

START_TEST(s21_truncate_edge_2) {
  s21_decimal value_1 = {{0xD487DA, 0x0, 0x0, 0x1D0000}};
  s21_decimal value_2 = {{0}};
  int code = 1;
  int my_code = s21_truncate(value_1, &value_2);
  ck_assert_int_eq(code, my_code);
}
//#############################################################################

